import "./Projects.css";

export default function Projects() {
    return (
        <main>
            <div className="container">
                <h1>Mes projets académiques et personnels</h1>    
                <hr className="divider"></hr>
                bite
                <h1>Jeux vidéos</h1>    
                <hr className="divider"></hr>
            </div>
        </main>
    );
}
